sage\",\"message\":\"Welcome [client_f_name]. Your monthly payment is [monthly_fees]. Pay via  paybill No. 4061913 account no [acc_no]. Your next expiration date is [exp_date].\"}]},{\"Name\":\"sms_bill_manager\",\"messages\":[{\"Name\":\"welcome_client_sms\",\"message\":\"Vipi [client_f_name] karibu Hypbits, utafanya malipo yako ukitumia paybill No. 4061913 na akaunti namba [acc_no]  kwa [sms_rate] kwa kila sms.\"},{\"Name\":\"rcv_coracc_billsms\",\"message\":\"Vipi [client_name], tumepokea malipo yako ya [trans_amnt] leo: [today] masaa ya [now]. Balance yako mpya ni [sms_balance] SMS.\"},{\"Name\":\"rcv_incoracc_billsms\",\"message\":\"Tumepokea [trans_amnt], Akaunti namba amabayo umepeana sio sahihi, tafadahli tuma jumbe fupi ukipeana namba yako ya simu na jina yako kwa 0743551250/0720268519\"},{\"Name\":\"rcv_belowmin_billsms\",\"message\":\"Vipi, [client_f_name], Malipo chini ya elfu moja haikubaliki tafadhali! Malipo ya chini inayo kubalika ni [min_amnt]\"},{\"Name\":\"msg_reminder_bal\",\"message\":\"Vipi, [client_f_name], SMS zako zimebaki [sms_balance] fanya malipo ukitumia paybill 4061913 kwa akaunti namba hii [acc_no] ili uziongesha kabla ziishe.\"}]},{\"Name\":\"account_freezing\",\"messages\":[{\"Name\":\"account_frozen\",\"message\":\"Dear [client_f_name] Your Acc [acc_no] will be frozen for [days_frozen] untill [unfreeze_date].  Your wallet Bal as of  [today] at [now] is [client_wallet]. For enquires call 0717748569/0720268519.\"},{\"Name\":\"account_unfrozen\",\"message\":\"Welcome back [client_f_name], Your Acc [acc_no] has been activated successfully after being frozen. Your new wallet Bal is  [client_wallet]. For enquires call 0717748569/0720268519.\"}]}]', 1, '20230620182439', 0),
